window.bookSummaryJSON = "<p>The last time Dr. Meghan Forester saw Davin and the other infected Kazzies, she made a heart-wrenching choice. Now, her new life is filled with loneliness.</p> <p>Trying to carry on while Davin and her friends are held captive on reservation one, Meghan begins a daunting position at Compounds 10 and 11 in Washington state. There, she is thrust into a challenging new world with a handsome assistant as her guide.</p> <p>But Meghan refuses to abandon her friends, so when reports surface of atrocities being committed within reservation one, she returns to South Dakota and discovers the only way to save Davin and her friends is to face her old enemy. An enemy who will stop at nothing to keep the Kazzies contained, even if that means taking a life.</p>"; 
